# chat gpt did the following
def parse_csv_to_json(csv_text):
    f = StringIO(csv_text)
    reader = csv.DictReader(f)
    data = []
    
    for row in reader:
        parsed_row = {}
        for k, v in row.items():
            if v == '':
                parsed_row[k] = None
            else:
                # Try to convert to int or float
                try:
                    if '.' in v:
                        parsed_row[k] = float(v)
                    else:
                        parsed_row[k] = int(v)
                except ValueError:
                    parsed_row[k] = v
        data.append(parsed_row)
    return data

# Convert CSV to JSON
json_data = parse_csv_to_json(csv_data)

# Export to a file
with open('transit_data.json', 'w', encoding='utf-8') as f:
    json.dump(json_data, f, indent=2, ensure_ascii=False)

print("JSON exported to 'transit_data.json'")
